import './App.css';
import Home from "./pages/Home";
import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import NavbarHeader from "./components/Header/Header";
import AboutMe from "./pages/AboutMe"; // Ajusta la ruta según la ubicación de tu archivo AboutMe


function App() {
  return (
    <>
    <div className="App">
      <Home/>
    </div>
    <Router>
      <NavbarHeader />
      <Switch>
        {/* Ruta para "SOBRE MÍ" */}
        <Route path="/AboutMe">
          <AboutMe />
        </Route>
        {/* Otras rutas */}
      </Switch>
    </Router>
    </>

  );
}

export default App;
